import { Carousel, Card } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const cardsData = [
  {title: "Card 1", image: '"https://files.thesirona.com/site-images/400x400/Period-Stain-Remover-1.jpg"', content: "Content for card 5555"},
  {title: "Card 2", content: "Content for card 2"},
  {title: "Card 3", content: "Content for card 3"},
  {title: "Card 4", content: "Content for card 4"},
  {title: "Card 5", content: "Content for card 5"}
];
function CardList() {
    return (
        <Carousel>
    
        {cardsData.map((card,index) => (
          <Card key={index}>
             <Card.Img variant="top" src="https://files.thesirona.com/site-images/400x400/Period-Stain-Remover-1.jpg" />
            <Card.Body>
          
              <Card.Title>{card.title}</Card.Title>
              <Card.Text>{card.content}</Card.Text>
            </Card.Body>
          </Card>
        ))}
      </Carousel>
    );
  }
export default CardList;
